import React from "react";
import { Card, Button } from "react-bootstrap";
import { useParams } from "react-router-dom";
import practitioners from '../sample_data/practitioners.json'


const DocterDetails = () => {
    let { id } = useParams();

    const view = practitioners.filter((practitioner) => (
        practitioner.id == id
    ))

    console.log(view)

    return (
        <div>
            <div>
                {view.map((item) => (
                    <Card>
                        <Card.Img src={item.image} alt="Image "/>
                        <Card.Body>
                            <h3><b>{view.name}</b></h3>
                            <p>Specialization: {view.speciality}</p>
                            <p>Availability: {view.availability}</p>
                            <div>
                                <Button>Book Now</Button>
                            </div>
                        </Card.Body>
                    </Card>
                ))}
            </div>
            <div>
                <h4>Services</h4>
                <ol>
                    <li>Item one</li>
                    <li>Iem 2</li>
                    <li>Item 3</li>
                </ol>
            </div>
        </div>
    )
}

export default DocterDetails
